function Bonus(props) {

  var bonus = 0;

  switch (props.value) {
    case 1:
      bonus = -5
      break;
    case 2:
    case 3:
      bonus = -4
      break;
    case 4:
    case 5:
      bonus = -3
      break;
    case 6:
    case 7:
      bonus = -2
      break;
    case 8:
    case 9:
      bonus = -1
      break;
  }

  return (
    <span className="block mx-auto w-8 text-sm bg-slate-500 text-white rounded-lg font-bold">{bonus}</span>
  )
}

export default Bonus;
